export class FrmLoginController{

        static async ValidUser(parUsuario: string|undefined,parSenha: string|undefined) 
        {
            try {
                const response = await fetch(`http://localhost:56624/api/Usuario/ValidarUsuario?parLogin=${parUsuario}&parSenha=${parSenha}`
                , {                
                    method: 'GET',
                    // headers: {
                    // accept: 'application/json',
                    // },
                });
            
                if (!response.ok) {
                    throw new Error(`Error! status: ${response.status}`);
                }        
                const result = await response.json();
                return result;
            } catch (err) {
                alert("ERROR: "+err);
            }
        }

        static async getUser() 
        {
            try {
              const response = await fetch(`http://localhost:56624/api/Usuario/ValidarUsuario?parLogin=${"admin"}&parSenha=${"admin"}`,{
                method: 'GET',
              });
          
              if (!response.ok) {
                throw new Error(`Error! status: ${response.status}`);
              }          
              const result = await response.json();
              return result;
            } catch (err) {
              console.log(err);
            }
        }
}
